import { useState } from "react";
import React from 'react'

export default function ViewProfile() {
    const [data, setData] = useState([]);
    const [order, setOrder] = useState('DSC');
    const [onceOff, setOnceOff] = useState(true);

    if (onceOff) {
        fetch(`http://127.0.0.1:5000/getContracts/1`, {
        'method': 'GET',
        headers: { 'Content-Type': 'application/json' }
        })
            .then(response => response.json())
            .then(response => setData(response))
            .catch(error => console.log(error));
        setOnceOff(false);
    }
  return (
    <div className="card">
        <form >
            <h1>Profile Preview</h1>
            <label className="custom-file-upload fas">
                <div className="img-wrap" >
                    <img for="photo-upload" src={'https://github.com/OlgaKoplik/CodePen/blob/master/profile.jpg?raw=true'} alt="Upload" />
                </div>
            </label>
            <div className="name">{"name"}</div>
            <div className="email">{"email"}</div>
            <div className="scale">JavaScript - {"scaleJava"}</div>
            <div className="scale">Python - {"scalePython"}</div>
            <div className="scale">C/C++ - {"scaleC"}</div>
            <div className="scale">Go - {"scaleGo"}</div>
            <button type="submit" className="styleBtn edit">Edit Details </button>
            <button className="deleteBtn" onClick={"handleDelete"}>Delete Account </button>
                <table>
                    <thead>
                <tbody>
                    {data.map((d) => (
                        <tr key={d.id}>
                            <td >{d.company_name}</td>
                            <td>{d.length}</td>
                            <td>{d.value}</td>
                            <td>{d.description}</td>
                            <td>{d.programming_language}</td>
                            <td>{d.location}</td>
                        </tr>
                    ))}
                </tbody>
                </thead>
                    </table>
        </form>
    </div>
  )
}
